import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class TaskCard extends React.Component{

    renderTitle(title){
        return(
            <h1>
                {title}
            </h1>
        )
    }

    renderTask(task){
        return(
            <h1>
                {task}
            </h1>
        );
    }

    renderAssignee(assignee){
        return(
            <h1>
                {assignee}
            </h1>
        );
    }

    render(){
        return(
            <div class = "taskcard">
                <div class = "card">
                    <div class = "title">
                            {this.renderTitle("Order Lunch")}
                        </div>
                    <div class = "task-footer">

                        <div class = "task">
                            {this.renderTask("Order fries")}
                        </div>
                        <div class = "assignee">
                            {this.renderAssignee("John Doe")}
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
  // ========================================

  ReactDOM.render(
    <TaskCard />,
    document.getElementById('root')
  );
